import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const ResultList = () => {
  /*const [queries, setQueries] = useState([]);

  useEffect(() => {
    const fetchQueries = async () => {
      try {
        const response = await fetchQueriesFromAPIGateway();
        setQueries(response);
      } catch (error) {
        console.error("Error fetching queries:", error);
      }
    };

    fetchQueries();
  }, []);

  const fetchQueriesFromAPIGateway = async () => {
    try {
      const response = await fetch("https://aej45saso5.execute-api.us-east-1.amazonaws.com/prod/search-test");
      if (!response.ok) {
        throw new Error("Failed to fetch queries");
      }
      const data = await response.json();
      return data.Items;
    } catch (error) {
      throw new Error("Error fetching queries: " + error.message);
    }
  }; */
  return (
    <>
      {/* Your existing code */}
      <div className="row">
        <div className="col-lg-12 card-margin">
          <div className="card">
            <div className="card-body">
              <div className="row">
                <div className="col-lg-12">
                  <div className="d-flex align-items-center mb-4">
                    <h5 className="card-title">Results</h5>
                  </div>
                </div>
              </div>
              <div className="row">
                <div className="col-lg-12">
                  <div className="table-responsive">
                    <table className="table table-bordered">
                      <thead className="thead-light">
                        <tr>
                          <th>Avatar</th>
                          <th>Name</th>
                          <th>Location</th>
                          <th>Salary</th>
                          <th>Rating</th>
                        </tr>
                      </thead>
                      <tbody>
                        {queries.map((query, index) => (
                          <tr key={index}>
                            <td>
                              <div className="widget-26-job-emp-img mt-2">
                                <img
                                  src="./images/user.jpg"
                                  alt="Company"
                                />
                              </div>
                            </td>
                            <td>
                              <div className="widget-26-job-title">
                                <p className="m-0">
                                  <Link
                                    to="/WalkerProfileForUser"
                                    className="employer-name"
                                  >
                                    {query.user_full_name.S}
                                  </Link>
                                </p>
                              </div>
                            </td>
                            <td>
                              <div className="widget-26-job-info mt-3">
                                <p className="text-muted m-0">
                                  <span className="location my-auto">
                                    {query.country && query.country.S
                                      ? query.country.S
                                      : 'N/A'}
                                  </span>
                                </p>
                              </div>
                            </td>
                            <td>
                              <div className="widget-26-job-salary mt-3">
                                $ 20
                              </div>
                            </td>
                            <td>
                              <div className="widget-26-job-starred mt-3">
                                <span
                                  className="m-auto"
                                  style={{
                                    color: "#fd8b2c",
                                    fontWeight: "600",
                                  }}
                                >
                                  5
                                </span>{" "}
                                <span
                                  style={{
                                    fontWeight: "lighter",
                                    fontSize: "10px",
                                  }}
                                >
                                  (25)
                                </span>
                                <a href="/#">
                                  <span className="icon-paw icon-paw-review" />
                                </a>
                              </div>
                            </td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
  
};
export default ResultList;
